B.yA=new A.aO("Despesas m\xe9dicas, Viagem internacional","Despesas m\xe9dicas, hospitalares e/ou odontol\xf3gicas em viagem ao exterior (DMHO viagem internacional)\u2013 Ela garante os mesmos itens da cobertura anterior:  indeniza\xe7\xe3o das despesas m\xe9dicas, hospitalares ou odontol\xf3gicas devido acidente pessoal ou doen\xe7a s\xfabita. A diferen\xe7a \xe9 que, por ser voltada para viagens internacionais, ela come\xe7a a valer assim que voc\xea sair do seu pa\xeds de origem.",null)
B.yu=new A.aO("Traslado m\xe9dico","Garante indeniza\xe7\xe3o das despesas de remo\xe7\xe3o ou transfer\xeancia at\xe9 a cl\xednica ou hospital mais pr\xf3ximo, por motivo de acidente pessoal ou enfermidade coberta. Ou seja, se ocorrer algum acidente que voc\xea precise de locomo\xe7\xe3o at\xe9 um hospital, esta cobertura ir\xe1 cobrir as despesas.",null)
