B.yo=new A.aO("Traslado de corpo","Em caso de morte, garante indeniza\xe7\xe3o das despesas com a libera\xe7\xe3o e transporte do corpo do segurado do local da ocorr\xeancia at\xe9 o local de sepultamento.",null)
